        date={expenses[0].date}
        price={expenses[0].price}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[1].title}
        date={expenses[1].date}
        price={expenses[1].price}
      ></ExpenseItem>
      <ExpenseItem
        title={expenses[2].title}
        date={expenses[2].date}
        price={expenses[2].price}
      ></ExpenseItem>
    </div>
  );
};
